import React, { useEffect } from 'react'
import { useDispatch } from 'react-redux'
import { getonlineusers } from './actions/user_actions';
function UsersList(props) {
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch(getonlineusers(props))
    }, [dispatch, props])
    return (
        <div className="leftUsersContainer" >
            {
                props.onlineUsers[0] ?
                    props.onlineUsers[0].map((elem, index) => (
                        elem.userId ?
                            <div key={index} className="leftUserContent">
                                <i className="fa fa-user-circle-o userIcon "></i>
                                <h3>{elem.username}</h3>
                                <i className="fa fa-circle active"></i>
                            </div>
                            :
                            ""
                    ))
                    :
                    ""
            }

        </div >
    )
}

export default UsersList
